(275, 14, 'محمد النمكي.. السبت', 'دكرنس', NULL, 'عظام', 'متابعه والدنيا كانت واقعه عنده وكان عنده حاله واحده من بورسعيد وكتب لها ع سليكون فلات فوت ولكن الحاله قالت انا اتأخرت ممكن نجيبه من بورسعيد فاسألوا الدكتور قالهم معرفش سعره روحوا للمركز ده كويس', '2021-01-25 17:13:59'),
(276, 14, 'هشام الدسوقي .. السبت', 'دكرنس', NULL, 'عظام', 'متابعه ويقوله حمدلله ع السلامه لأنه لسه نازل عيادته يوم الاتنين لأنه كان عنده كورونا والدنيا عنده شغاله وقالي والله مش بلعت غير عليكم', '2021-01-25 20:54:37'),
(277, 14, 'أيمن حسين.. السبت', 'دكرنس', NULL, 'عظام', 'متابعه وضغط عليه ف الكلام عشان الحالات وكان عنده حالات كتير وكان واقف مستعجل لكن بلغته انا ف المكتب ومنظره منك', '2021-01-25 20:57:39'),
(278, 14, 'محمد ياسر.. السبت', 'دكرنس', NULL, 'عظام', 'متابعه الدكتور واتكلمنا ف حالة الدانس براون وقالي بعت لبا حاله فرشه فندا عرفته لسه ماوصلتش ليا وفين باقي الشغل يادكتور إحنا مش اتكلمنا وقولت لحضرتك انا موفرة عندي المنتجات الأسعار على قد ايد الحاله وف نفس الوقت عندي البرندات بتاعتي قالي والله كل اللي بيقبلني ليكي قولتله عايزه اشوف', '2021-01-26 12:23:26'),
(279, 14, 'صلاح الدين رفعت... الأحد', 'الدوار', NULL, 'عظام', 'متابعه وان اسيب برشورات ف العياده بس كانت الدنيا هاديه واتكلمنا مع بعض ف الحالات بس الدكتور محتاج هديه ودي شيفاها من وجهة نظري', '2021-01-26 12:24:50'),
