(282, 14, 'ابراهيم عبد الموجود.. الاحد', 'الدوار', NULL, 'جراحة', 'كول جبنرال وفتح معايا كلام لو نأجر منه المحل في ولاد صقر وهو فاتح كمان ف ولاد صقر ويشاركنا وفيه هناك دكاتره كتير', '2021-01-26 12:28:14'),
(283, 14, 'عيد حسن.. الثلاثاء', 'المحموديه', NULL, 'عظام', 'فيدباك حالات الشوزات لأنه لما بييجي يبعت الخاله بيبعتها علينا وع مركز خالد الديب فكنت لازم اتكلم معاه واشوف حضرتك بيبقى ليك مواصفات خاصه.. لقيته بيقول والله انا ببعت عليكم الأول بس برده بخير الحاله عشان ماتقولش اشمعنا المركز ده يادكتور', '2021-01-27 12:53:33'),
