(291, 14, 'سلوى حنفي... الثلاثاء', 'المحموديه', NULL, 'علاج طبيعي', 'المتابعه وفتح كلام في الني جروب وقالت بيتعرض عليا الاكتر حالات أحزمة الضهر اللي بيبعتها وبرده أن شاء الله من المستشفي لو فيه حاجه هبعتلك من هناك ع طول', '2021-01-27 12:55:51'),
(292, 14, 'سلوى حنفي... الثلاثاء', 'المحموديه', NULL, 'علاج طبيعي', 'المتابعه وفتح كلام في الني جروب وقالت بيتعرض عليا الاكتر حالات أحزمة الضهر اللي بيبعتها وبرده أن شاء الله من المستشفي لو فيه حاجه هبعتلك من هناك ع طول', '2021-01-27 12:55:54'),
(293, 14, 'محمد رمضان.. الثلاثاء', 'المحموديه', NULL, 'علاج طبيعي', 'اتكلم معايا ف الشوزات محتاج لو الطفل لسه مش بيمشي ياخد حاجة سعرها قليل ولو لطفل بيمشي ياخد احسن حاجة عشان تفضل معاه ومحتاج اسعار الجباير والكوك اب ومحافظ الركبه تنزل أسعارها لأن عامل كوك اب ف الجماليه لشاب ب١٥٠ج', '2021-01-27 12:58:27'),
(294, 14, 'عطيه عزت.. الاربعاء', 'منية النصر', NULL, 'عظام', 'متابعه والكلام مع الدكتور ولقيته بيبعت بالبرشور بتاعنا لكن مابيحددش العنوان للحاله.. فتقوم الحاله طالعه جيباه من المستلزمات وجايه. فلما دخلت لقيته بيقولي ابعتلك هنجد ني بريس وهب ابدكشن شكرته وقولتله وصلني الهب ابدكشن لكن لسه التانيين ف الطريق بس نأكد ع العنوان يادكتور', '2021-01-30 11:25:45'),
(295, 14, 'حمدي الحديدي... الأربعاء', 'منية النصر', NULL, 'عظام', 'المتابعه وبيقولي ياحياه مش محتاجة توصيه بس اول ماتجيلي وأول السنه تيجي بأيدك فاضيه لازم من الوقت للتاني حاجة كده وانا ببعتلك سليكونات كتير جدا وايدي ع الورق بتاعكم', '2021-01-30 11:27:37'),
(296, 14, 'محمد السروي', 'منية النصر', NULL, 'عظام', 'المتابعه وفتح معايا مؤتمر ف شهر ٣', '2021-01-30 11:28:23'),
(297, 14, 'هيثم يوسف أبو السعد', 'منية النصر', NULL, 'أوعية دمويه', 'المتابعه والرجوع العياده لأنه كان تعبان والاطمئنان وكلام ع الشغل ع خفيف انه مايكونش ناسينا', '2021-01-30 11:37:09'),
(298, 14, 'احمد عبدالفتاح', 'منية النصر', NULL, 'عظام', 'بقاله فتره كبيره مش بيبعت ومابيكونش موجود ف العياده فقالي والله كنت بحضر للزماله ومكنتش فاضي ورجع اتكلم معايا ف أن انا أوفر منتجاتي ف المستلزمات اللي جانبه ف الرياض', '2021-01-30 11:39:07'),
